import React, { useState } from 'react';
import styled from 'styled-components';

// Styled components
const PageContainer = styled.div`
  background-color: #444442;
  min-height: 100vh;
  padding-top: 85px;
`;

const Header = styled.h1`
  font-family: 'Poppins', sans-serif, 'arial';
  font-weight: 600;
  font-size: 72px;
  color: white;
  text-align: center;
`;

const SubHeader = styled.h4`
  font-family: 'Roboto', sans-serif, 'arial';
  font-weight: 400;
  font-size: 20px;
  color: #9b9b9b;
  text-align: center;
  margin-bottom: 20px;
`;

const InputContainer = styled.div`
  width: 650px;
  max-width: 100%;
  margin: 20px auto 25px auto;
`;

const StyledInput = styled.div`
  position: relative;
  margin: 1rem 0;
  border-radius: 4px;
  width: ${props => props.wide ? '650px' : '293px'};

  @media only screen and (max-width: 768px) {
    width: 100%;
  }
`;

const Input = styled.input`
  padding: 30px;
  border: 0;
  width: 100%;
  font-size: 1rem;
  background-color: #2d2d2d;
  color: white;
  border-radius: 4px;

  &:focus {
    outline: 0;
  }
`;

const TextArea = styled.textarea`
  padding: 30px;
  border: 0;
  width: 100%;
  min-height: 15em;
  font-size: 1rem;
  background-color: #2d2d2d;
  color: white;
  border-radius: 4px;

  &:focus {
    outline: 0;
  }
`;

const Label = styled.label`
  color: #999;
  padding: 1.3rem 30px 1rem 30px;
  position: absolute;
  top: 10px;
  left: 0;
  transition: all 0.25s ease;
  pointer-events: none;
`;

const SubmitButton = styled.div`
  float: right;
  padding: 7px 35px;
  border-radius: 60px;
  background-color: #4b8cfb;
  color: white;
  font-size: 18px;
  cursor: pointer;
  box-shadow: 0 2px 5px rgba(0,0,0,0.06), 0 2px 10px rgba(0,0,0,0.07);
  transition: all 300ms ease;

  &:hover {
    transform: translateY(1px);
    box-shadow: 0 1px 1px rgba(0,0,0,0.10), 0 1px 1px rgba(0,0,0,0.09);
  }

  @media (max-width: 768px) {
    width: 100%;
    float: none;
    text-align: center;
  }
`;

// Main Contact component
const Contact = () => {
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [phone, setPhone] = useState('');
  const [message, setMessage] = useState('');
  const [status, setStatus] = useState("Send Message");

  const handleSubmit = async (event) => {
    event.preventDefault();

    setStatus("Sending...");
    let details = {
      name,
      email,
      phone,
      message,
    };

    fetch("http://localhost:5000/contact", {
      method: "POST",
      headers: {
        "Content-Type": "application/json;charset=utf-8",
      },
      body: JSON.stringify(details),
    })
    .then(response => {
      if (!response.ok) {
        throw new Error(response.statusText);
      }
      return response.json();
    })
    .then(result => {
      setStatus("Send Message");
      setName("");
      setEmail("");
      setPhone("");
      setMessage("");
      alert(result.status);
    })
    .catch(error => console.error('Error:', error));

    setStatus("Send Message");
  };

  return (
    <PageContainer>
      <Header>Contact Us</Header>
      <SubHeader>We'd love to hear from you!</SubHeader>
      <form onSubmit={handleSubmit}>
        <InputContainer>
          <StyledInput wide>
            <Input
              type="text"
              value={name}
              onChange={(event) => setName(event.target.value)}
              required
            />
            <Label>Name</Label>
          </StyledInput>

          <StyledInput>
            <Input
              type="email"
              value={email}
              onChange={(event) => setEmail(event.target.value)}
              required
            />
            <Label>Email</Label>
          </StyledInput>

          <StyledInput>
            <Input
              type="text"
              value={phone}
              onChange={(event) => setPhone(event.target.value)}
              required
            />
            <Label>Phone Number</Label>
          </StyledInput>

          <StyledInput wide>
            <TextArea
              value={message}
              onChange={(event) => setMessage(event.target.value)}
              required
            />
            <Label>Message</Label>
          </StyledInput>

          <SubmitButton type="submit">{status}</SubmitButton>
        </InputContainer>
      </form>
    </PageContainer>
  );
};

export default Contact;
